export const FETCH_POSTS = "POSTS/FETCH_POSTS"



export function fetchData () {
    const request = axios.get('http://localhost:3000/flug');
    console.log(request);
    return(
        {
            type: FETCH_POSTS,
            payload: request
        }
    )
};
